export class Stack {
    constructor() {
        globalThis.stack = [];
    }
    push(item) { this.stack.push(item); }
    pop() { return this.stack.pop(); }
    peek() {return this.stack[this.stack]}
    isEmpty() { return this.stack.length === 0; }
    clear() {this.stack = []; }
}
